/* eslint-disable no-underscore-dangle */
/* eslint-disable no-lone-blocks */
/* eslint-disable jsx-a11y/anchor-is-valid */
import PropTypes from 'prop-types';
// w-full
const CardCourse = ({ course }) => (
  <div className="flex transition hover:translate-x-4 duration-700 max-w-md mx-auto bg-black text-white rounded-xl shadow-md overflow-hidden md:max-w-2xl">
    <div className="md:flex bg-slate-600 flex justify-center">
      <div className="md:shrink-0">
        <img className="h-48  object-cover md:h-full md:w-48" src={course.image} alt="Man looking at item at a store" />
      </div>
      <div className="p-8">
        <p className="uppercase tracking-wide h-8 text-sm text-white text-center border-y border-indigo-600 font-semibold">
          {course.teacher}
        </p>
        <p href="#" className="block mt-1 text-lg leading-tight font-medium">
          {course.title}
        </p>
        {/* <p className="mt-2 text-slate-500">
          {course.description}
        </p>
        <span>{course.place}</span> */}
      </div>
    </div>
  </div>
);

CardCourse.propTypes = {
  course: PropTypes.string.isRequired,
};

export default CardCourse;

